            <a href='#'>CARBON ABSORBING</a>
            <a href='#'>START YOUR AUDIT</a> */}


          </div>
        </div>

        <div className='row'>
          <div className='col'>
            {qBank.map((i, key) => {

              return (<>
                <ul key={key}>
                  <li>{i.question}</li>
                  <li><li>{i.answer.map((op) => {
                    return (
                      <>
                        <ul>
                          <li>
                            <input type='radio' name='anwer' />{op}
                          </li>
                        </ul>
                      </>
                    )
                  })}</li>
                    <label className='answers'></label>

                  </li>
                </ul>
              </>

              )

            })}
          </div>
        </div>
      </section>
    </>
  )
}
export default Quiz;
